void calc(char *Input)
{
	unsigned int HighWord = *(unsigned int *)Input;
	unsigned int LowWord = ((unsigned int *)Input)[1];

	//Loop :D
	for (int i = 0; i < sizeof(ConstArray) / sizeof(unsigned int); i++) {
		unsigned int NR = ConstArray2[i] ^ (LowWord + ((LowWord << 4) ^ (LowWord >> 5)));
		NR = NR + HighWord;
		HighWord = LowWord;
		LowWord = NR;
	}

	//GOLDFIST
	if (LowWord == 0x16359C65)
	{
		printf("WORKS!\n");
		printf("Output = %08X %08X\n", HighWord, LowWord);
		for (int i = 0; i < 8; i++) {
			printf("%c", Input[i]);
		}
		printf("\n");
	}
}

